import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import GenerateImagePage from './pages/GenerateImagePage';
import AccountSettingsPage from './pages/AccountSettingsPage';
import LoginPage from './pages/LoginPage';
import GalleryPage from './pages/GalleryPage';
import PrivateRoute from './components/PrivateRoute';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/gallery" element={<PrivateRoute><GalleryPage /></PrivateRoute>} />
        <Route path="/generate" element={<PrivateRoute><GenerateImagePage /></PrivateRoute>} />
        <Route path="/account" element={<PrivateRoute><AccountSettingsPage /></PrivateRoute>} />
      </Routes>
    </Router>
  );
}

export default App;
